import React, { useState, useEffect } from "react";

const Card = () => {
    const [breeds, setBreeds] = useState(initialBreeds);

    useEffect(() => {
        updateBreeds();
    }, []);

    const updateBreeds = () => {
        getBreeds()
        .then((newBreeds) => {
            setBreeds(newBreeds)
        })
        .catch(
            console.log("Erro")
        )
    }

return (
	<div className='card'>
		<img src={breeds.image_url} alt={breeds.name} />
		<p>dog name</p>
	</div>
);
}

export default Card;
